import React from 'react'
import AdminNavbar from '../components/ClientNavbar'
import { Outlet } from "react-router-dom";

export default AdminLayout = () => {
  return (
    <>
      <AdminNavbar />
      <div style={{ padding: "20px" }}>
        <Outlet />
      </div>
    </>
  )
}
